    map['hasMore'] = hasMore;
    map['hasSingleImmediateReply'] = hasSingleImmediateReply;
    if (users != null) {
      map['users'] = users?.map((v) => v.toJson()).toList();
    }
    map['text'] = text;
    map['count'] = count;
    return map;
  }
